	(7894,'http://www.villagevoice.com/events/bye-bye-kitty-between-heaven-and-hell-in-contemporary-japanese-art-2427993/','Bye Bye Kitty!!! Between Heaven and Hell in Contemporary Japanese Art','bye-bye-kitty-between-heaven-and-hell-in-contempor','Who would want to kill Hello Kitty? Certainly not us. But for many Japanese artists, their countrys obsession with all things childish and cute (or kawaii) can be stifling. Using neo-pop artist Yoshitomo Naras photo of a gravestone adorned by Hello Kitty statues as the shows touchstone, the exhibit  Bye Bye Kitty!!! Between Heaven and Hell in Contemporary Japanese Art  features work by 16 emerging and mid-career artists who aim to confront these cultural stereotypes. The exhibit includes Makoto Aidas Harakiri School Girls, a cartoon of bloody schoolgirls covered in their own entrails (yeah, really not cute), and Chiharu Shiotas installation Dialogue With Absence, a painted wedding dress combined with tubes pulsing with red-dyed water to represent a womans dreamlike, unconscious state of anxiety. Another reason to visit Japan Society: Now through June 30, 50 percent of all ticket and admission sales will go to their Earthquake Relief Fund.',4,'2011-05-24 16:51:04','2011-05-24 16:51:04','http://www.villagevoice.com/events/bye-bye-kitty-between-heaven-and-hell-in-contemporary-japanese-art-2427993/','http://vvoice.vo.llnwd.net/e14//6119158.47.jpg','',121,'event_images/4784b74dbcfbcfdd4a440a82051b939ff430fe7b.jpg',1,2),
