	(7892,'http://www.villagevoice.com/events/times-new-viking-the-babies-2584267/','Times New Viking+the Babies','times-new-vikingthe-babies','Like their twist on the ever present font, Columbus\' Times New Viking add an unexpected edge to their lo-fi indie rock. Often likened to Guided By Voices (there\'s the same melodic discombobulation) and tagged with the unfortunate label \"shitgaze\" in the blogs, the rush of boy-girl vocals and scuzzed-out guitars on their new album  Dancer Required  sound sumptuously sweeter this time around. Supporting the band is incestuous Brooklyn crew the Babies, culled from members of Vivian Girls, Woods, Bent Outta Shape, and Bossy, who build lilting art rock out of a whole lotta love.',4,'2011-05-24 16:51:04','2011-05-24 16:51:04','http://www.villagevoice.com/events/times-new-viking-the-babies-2584267/','http://vvoice.vo.llnwd.net/e14//6365266.47.jpg','',137,'event_images/bd170852a3c75d608248b2aab27407d45e596916.jpg',1,3),
