	(8101,'http://www.villagevoice.com/events/american-idiot-1707430/','American Idiot','american-idiot','Between \"Lust for Life\" \'s revival as a Carnival Cruise jingle and the agonizing walk past the John Varvatos store where CBGB\'s used to be, it\'s no secret that punk-rock culture has seen some ugly lows. Green Day\'s Broadway musical  American Idiot , however, may just carve out a mosh pit for itself among these contenders. Tony-winning director Michael Mayer ( Spring Awakening ) is behind this venture, which features songs from the  American Idiot  and  21st Century Breakdown  albums. The show premiered at the Berkeley Rep and earned a range of decent to glowing reviews. From what we can tell, expect lots of heavily stylized thrashing and sets that make for a candy-colored faux-boho vibe not wholly unlike  Rent . John Gallagher Jr., who won a Tony for his role in  Spring Awakening , stars as the jaded suburbanite slacker Johnny.',4,'2011-05-24 16:51:30','2011-05-24 16:51:30','http://www.villagevoice.com/events/american-idiot-1707430/','http://vvoice.vo.llnwd.net/e14//4553433.47.jpg','',124,'event_images/c0603abd5a5015d21396c01738b7690510ee04cd.jpg',1,0),
