	(8135,'http://www.villagevoice.com/events/elvis-costello-2575278/','Elvis Costello','elvis-costello','Elvis Costello  meets John Cage, sort of, when rock\'s least boring middle-aged overachiever (do any of his peers host a cool television show and compose classical music?) hits the road with his Spectacular Spinning Songbook for the first time in a quarter-century. Audience members who spin the wheel will savor their selections from an onstage lounge as the Imposters (i.e., the Attractions with a different bassist, and still the most excitably taut combo to survive the \'70s apunkalypse) deliver the goods from a 150-song grab bag. Costello will emcee the spectacle in his Napoleon Dynamite persona, navigating audience requests, random selections from a pile of sheet music, solo renditions, and cover versions amid whatever spontaneous chance operations emerge. In other words, expect Costello at his most charmingly impish.',4,'2011-05-24 16:51:34','2011-05-24 16:51:34','http://www.villagevoice.com/events/elvis-costello-2575278/','http://vvoice.vo.llnwd.net/e14//6337142.47.jpg','',137,'event_images/e18025b21212c3aecab3eb735f6e28d9db7acf46_1.jpg',1,0),
