	(8202,'http://www.villagevoice.com/events/fang-island-2585999/','Fang Island','fang-island','Why should Schubert have all the fun? In both sound and attitude, Fang Island\'s self-titled 2010 debut was all about the overture. Slabs of three-guitar ham steak shouldered happily against wiggy electronics and a crowded ruckus of wails, the sort of joyous choruses you\'d hear from the Polyphonic Spree or even the Flaming Lips, whom these guys have toured with. It was outsized. It was fun. Shucks, it was even uplifting. It was also kind of like a really loud, really exciting one-act play, so we\'ll see what the next few months bring for the boys from Fang. Idea: four guitars.',4,'2011-05-24 16:51:43','2011-05-24 16:51:43','http://www.villagevoice.com/events/fang-island-2585999/','http://vvoice.vo.llnwd.net/e14//6365153.47.jpg','',137,'event_images/ed0babcffd141ebcc218b7fd0c228c4f077065b2.jpg',1,0),
