	(8894,'http://www.villagevoice.com/events/radio-play-2546708/','Radio Play','radio-play','Are you afraid of the dark? Don\'t worryat P.S.122, the lights may be dimmed, but the only thing hiding is master musician Reggie Watts and his cohorts in his  Radio Play . Watts is an impressive performance artist who uses his increasingly popular and unique blend of comedy and loop-pedal work to astonish audiences worldwide. For this performance, Watts collaborated with playwright and director Tommy Smith, enlisting the help of actors, musicians, and sound-effects artists to put a new twist on the historical radio drama. Expect a nonlinear, surreal spin of songs, stories, and soundscapes that play with the politics of pop culture. Embrace the retro-fueled fun with your eyes closed and ears open.',4,'2011-05-24 16:53:14','2011-05-24 16:53:14','http://www.villagevoice.com/events/radio-play-2546708/','http://vvoice.vo.llnwd.net/e14//6278426.47.jpg','',125,'event_images/c0b3d6e5d035fa27956e84bd3dbd37d3def4102c.jpg',1,0),
